@Test
    public void createInstanceFromValidJson() {
        final ModifyResourcesResponse underTestUpdated =
                ModifyResourcesResponse.fromJson(KNOWN_JSON, TestConstants.EMPTY_DITTO_HEADERS);

        assertThat(underTestUpdated).isNotNull();
    }

